let cart = document.querySelector(".cart");
let carticon = document.querySelector("#icon-cart");
let closecart = document.querySelector("#close-cart");

// open cart
carticon.onclick = () => {
  cart.classList.add("active");
};

// close cart
closecart.onclick = () => {
  cart.classList.remove("active");
};

// if (document.addEventListener("DOMContentLoaded", ready())) {  readytstate Ù„ÙŠ Ù…Ù†Ø¹Ù…Ù„Ø´ Ø§Ù„ÙƒÙˆØ¯ Ø¯Ù‡ ÙƒØ¯Ø§ Ø¹Ù„ÙŠ Ø·ÙˆÙ„  Ø¨Ø¯Ù„ Ù…Ù†Ø­Ø·
//   ready();
// }

// cart working js
if (document.readyState == "loading") {
  document.addEventListener("DOMContentLoaded", ready());
} else {
  ready(); //  ØŸelse Ø¹Ø§ÙŠØ² Ø§Ø¹Ø±Ù Ø§ÙŠ Ù„Ø§Ø²Ù…Ø© Ø§Ù„ÙƒÙˆØ¯ Ø¨ØªØ§Ø¹ Ø§Ù„
}

// ready function to remove the cart product
function ready() {
  let removeCartButton = document.getElementsByClassName("cart-remove");
  for (let i = 0; i < removeCartButton.length; i++) {
    let button = removeCartButton[i];
    button.addEventListener("click", removeCartItem);
  }

  // quantety change
  let quantetyInput = document.getElementsByClassName("cart-quantity");
  for (let i = 0; i < quantetyInput.length; i++) {
    let inputqunt = quantetyInput[i];
    inputqunt.addEventListener("change", quantetyChanged);
  }
}

function removeCartItem(e) {
  let buttonClicked = e.target;
  buttonClicked.parentElement.remove();
}

// if the qount number <= 0 the qount number.value =1
function quantetyChanged(e) {
  let input = e.target;
  if (isNaN(input.value) || input.value <= 0) {
    input.value = "1";
  }
  updateTotal();
}

// add Cart Function

function addCartClicked(e) {
  let button = e.target;
  let shopProducts = button.parentElement;
  let title = shopProducts.getElementsByClassName("product-title").innerText;
  let price = shopProducts.getElementsByClassName("price").innerText;
  let productImg = shopProducts.getElementsByClassName("product img")[0].src;
  addProductToCart(title, price, productImg);
  updateTotal();
}

function addProductToCart(title, price, productImg) {
  // Create cart shopbox element
  let cartShopbox = document.createElement("div");
  cartShopbox.classList.add("cart-box");

  // Find the cart item container
  let cartItem = document.querySelector(".cart-contant");
  let cartItemName = cartItem.querySelectorAll(".cart-product-title");

  // Check if the item is already in the cart
  for (let i = 0; i < cartItemName.length; i++) {
    if (cartItemName[i].innerText === title) {
      alert("You have already added this item to the cart");
      return;
    }
  }

  // Create the HTML content for the cart item
  let cartBoxContent = `
    <img src="${productImg}" alt="" class="cart-img" />
    <div class="detail-box">
      <div class="cart-product-title">${title}</div>
      <div class="cart-product-price">${price}</div>
      <input type="number" name="" id="" value="0" class="cart-quantity" />
    </div>
    <!-- Remove item -->
    <i class="bx bx-trash cart-remove"></i>`;

  // Set the HTML content to the cart shopbox
  cartShopbox.innerHTML = cartBoxContent;

  // Append the cart shopbox to the cart item container
  cartItem.append(cartShopbox);

  // Add event listener for removing item
  cartShopbox
    .querySelector(".cart-remove")
    .addEventListener("click", removeCartItem);

  // Add event listener for quantity changes
  cartShopbox
    .querySelector(".cart-quantity")
    .addEventListener("change", quantetyChanged);

  console.log("done");
}

// update total
function updateTotal() {
  let cartContent = document.getElementsByClassName("cart-contant")[0];
  let cartBoxes = cartContent.getElementsByClassName("cart-box");
  let total = 0;
  for (let i = 0; i < cartBoxes.length; i++) {
    let cartBox = cartBoxes[i];
    let priceElement = cartBox.querySelector(".cart-product-price");
    let quantityElement = cartBox.getElementsByClassName("cart-quantity")[0];
    let price = parseFloat(priceElement.innerText.replace("$", ""));
    let quantity = quantityElement.value;
    total += price * quantity;
  }
  total = Math.round(total * 100) / 100;
  document.getElementsByClassName("total-price")[0].innerText = total;
}

