export class ApiInteractor {
  private apiClient;

  constructor(api_uri: string) {
    this.apiClient = axios.create({
      baseURL: api_uri,
    });
    this.apiClient = addAxiosDateTransformer(this.apiClient);
  }

  private notifyError(message: string) {
    notifications.show({
      message: message,
      color: "stiegelerOrange",
      type: "error",
    });
  }

  protected apiCallWrapper<T>({
    endpoint,
    method = "get",
    params = {},
    notifyOnErrors = true,
  }: {
    endpoint: string;
    method?: "get" | "post" | "put" | "delete";
    params?: any;
    notifyOnErrors?: boolean;
  }): Promise<T> {
    console.debug(`API call: ${method} ${endpoint} ${JSON.stringify(params)}`);
    let promise;
    if (method === "get" || method === "delete") {
      promise = this.apiClient[method]<T>(endpoint, {
        params: params,
      });
    } else {
      promise = this.apiClient[method]<T>(endpoint, null, { params: params });
    }
    return promise
      .then((response) => response.data)
      .catch((error) => {
        console.error(error);
        let message = `Error calling ${method} ${endpoint}: `;
        if (error.response) {
          message += `${error.response.status as string} ${
            error.response.statusText
          }, ${
            error.response.data.detail
              ? error.response.data.detail
              : "no details provided"
          }`;
        } else {
          message += error.message;
        }
        if (notifyOnErrors) {
          this.notifyError(message);
        }
        throw error;
      });
  }
}

