export const chatbotConfigApiInteractor = new ChatbotConfigApiInteractor();

/**
 * Fetch the default chatbot settings and call the onChatbotSettingsFetched callback with the settings.
 * To be used as an effect. Uses an async function behind the scenes.
 * @param onChatbotSettingsFetched Callback to be called with the fetched settings.
 */
export function fetchDefaultChatbotSettings({
  onChatbotSettingsFetched,
  onError,
}: {
  onChatbotSettingsFetched: (settings: ChatbotSettings) => void;
  onError?: () => void;
}) {
  async function fetchDefaultChatbotSettingsAsync() {
    let llm = await chatbotConfigApiInteractor
      .getDefaultLLM()
      .catch(() => (onError ? onError() : undefined));

    let creativityFloat = await chatbotConfigApiInteractor
      .getDefaultTemperature()
      .catch(() => (onError ? onError() : undefined));

    let documentCollection = await chatbotConfigApiInteractor
      .listDocumentCollections()
      .catch(() => (onError ? onError() : undefined));
    let documentCollectionName;
    if (
      documentCollection &&
      documentCollection.length > 0 &&
      documentCollection[0].name
    ) {
      documentCollectionName = documentCollection[0].name;
    }

    onChatbotSettingsFetched({
      llm: llm ?? undefined,
      documentCollection: documentCollectionName,
      retrievalK: retrievalK ?? undefined,
      retrievalModes: retrievalModes ?? undefined,
      retrievalQueryMode: retrievalQueryMode ?? undefined,
      creativityPercent: creativityFloat ? creativityFloat * 100 : undefined,
      debug: true, // TODO set to false in production
    });
  }
  fetchDefaultChatbotSettingsAsync();
}
